import React from 'react';
import { useNavigate } from 'react-router-dom';

const RedirectToExit = ({ steps }) => {
  const navigate = useNavigate();

  React.useEffect(() => {
    const timer = setTimeout(() => {
      navigate('/exit', { state: steps.metadata });
    }, 5000);

    return () => {
      clearTimeout(timer);
    };
  }, [navigate, steps.metadata]);

  return null;
};

export default RedirectToExit;
